function toggleMenu(){var x=document.getElementById("navbarResponsive");"block"===x.style.display?x.style.display="none":x.style.display="block"}function parallax(){if(document.getElementById("parallax"))for(var img=document.getElementsByTagName("img"),i=0;i<img.length;i++)img[i].style.transform="translateY("+.2*window.scrollY*-i+"px)",console.log(i)}window.addEventListener("scroll",parallax);